import './css/style.css';

const Header = () => {
  return (
    <div className="header">
    <h1>Hello World</h1>
    </div>
  );
}

const Nav = () => {
  return ( 
    <nav>
      <ul>
        <li>CSS</li>
        <li>JS</li>
        <li>REACT</li>
      </ul>
    </nav>
  );
}

export default Header;
